import {BrowserRouter as Routes, Router, Route } from 'react-router-dom';
import './App.css';
import FormAuth from './components/FormAuth';



function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={<FormAuth/>} />
        </Routes>
      </Router>  
    </div>
  );
}

export default App;
